		}

		private void OnInput(IEntityInput entityInput, long frame)
		{
			var input = (EnemyGroup)entityInput;
			coherenceInput.DebugOnInputReceived(frame, entityInput);
			inputBuffer.ReceiveInput(input, frame);
		}
